import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';
import vasoFront from '../images/vasoFront.jpg';
import vasoSide from '../images/vasoSide.jpg'

const items = [
  {
    src: {vasoFront},
    key: 1,
    altText: 'Slide 1',
    caption: 'Slide 1',
    header: 'Slide 1 Header'
  },
  {
    src: {vasoSide},
    key: 2,
    altText: 'Slide 2',
    caption: 'Slide 2',
    header: 'Slide 2 Header'
  }
];

const keySlider = items.map((item)=>
      <div>{item}</div>
    )

const Slider = () => {
    
    return <UncontrolledCarousel key={items.item.key} items={items} />
} 

export default Slider;
